// SPDX-License-Identifier: MIT
pragma solidity ^0.8.30;

// Interface
interface IReceiver {
    function sum(uint _num1, uint _num2) external returns(uint);
    function difference(uint _num1, uint _num2) external returns(uint);
    function product(uint _num1, uint _num2) external returns(uint);
    function quotient(uint _num1, uint _num2) external returns(uint);
}

// Receiver contract
contract Receiver {
    uint public num1;
    uint public num2;

    function sum(uint _num1, uint _num2) external returns(uint) {
        num1 = _num1;
        num2 = _num2;
        return _num1 + _num2;
    }

    function difference(uint _num1, uint _num2) external returns(uint) {
        num1 = _num1;
        num2 = _num2;
        return _num1 - _num2;
    }

    function product(uint _num1, uint _num2) external returns(uint) {
        num1 = _num1;
        num2 = _num2;
        return _num1 * _num2;
    }

    function quotient(uint _num1, uint _num2) external returns(uint) {
        require(_num2 != 0, "Cannot divide by zero");
        num1 = _num1;
        num2 = _num2;
        return _num1 / _num2;
    }
}

// Caller contract
contract Caller {
    function callSum(address receiverAddress, uint a, uint b) external returns(uint) {
        return IReceiver(receiverAddress).sum(a, b);
    }

    function callDifference(address receiverAddress, uint a, uint b) external returns(uint) {
        return IReceiver(receiverAddress).difference(a, b);
    }

    function callProduct(address receiverAddress, uint a, uint b) external returns(uint) {
        return IReceiver(receiverAddress).product(a, b);
    }

    function callQuotient(address receiverAddress, uint a, uint b) external returns(uint) {
        return IReceiver(receiverAddress).quotient(a, b);
    }
}

